import React from 'react';
import ReactDOM from 'react-dom';

const AppComponent = () =>{
    window.navigator.geolocation.getCurrentPosition(
        position => console.log(position),
        err=> console.log
    );
    return "Hi There!";
};

ReactDOM.render(<AppComponent/>, document.querySelector('#root'))
